import React from 'react';
import SearchBox from '../../../../pokeapireactapp/src/components/SearchBox';

const FaceRecognition = ({ imageUrl, box }) => {
    return (
        <div className='center ma'>
            <div className='absolute mt2'>
                <img alt='img' id='inputImage'
                    src={imageUrl} width='500px' height='auto' />
                <div className='bounding-box' 
                style ={{top:box.topCol, right: box.rightRow, bottom: box.bottomRow, left:box.leftCol}}></div>
            </div>
        </div>
    )
}

export default FaceRecognition;
